import { useContext, useEffect, useState } from "react";
import { AuthContext } from "../../context";

export default function Homepage() {

  const { userGoogle } = useContext(AuthContext);
  console.log(userGoogle);
  
  const [isUserGoogleLoaded, setIsUserGoogleLoaded] = useState(false);

  useEffect(() => {
    if (Object.keys(userGoogle).length !== 0) {
      setIsUserGoogleLoaded(true);
    }
  }, [userGoogle]);

  console.log(userGoogle);

  return (
    <div className="container">
      <div className="row">
        <h1> Homepage </h1>
      </div>
      {isUserGoogleLoaded && (
        <>
          <div className="row">
            <div className="col-6 text-end">
              <h2>Bienvenue {userGoogle.name}</h2>
            </div>
            <div className="col-6 text-center">
              <img src={`${userGoogle.picture}`}></img>
            </div>
          </div>
          <div className="row">
            <p>Vous êtes connecté avec votre Compte Google</p>
          </div>
        </>
      )}
    </div>
  );
}
